library ieee;
use ieee.std_logic_1164.all;
use ieee.numeric_std.all;
use ieee.math_real.all;
use ieee.math_complex.all;

package COMPLEX_PKG is
  type BOOLEAN_VECTOR is array(NATURAL range <>) of BOOLEAN;
  type INTEGER_VECTOR is array(NATURAL range <>) of INTEGER;
  type REAL_VECTOR is array(NATURAL range <>) of REAL;
  alias COMPLEX is STD_LOGIC_VECTOR; -- IM & RE, both SIGNED and of same length so COMPLEX length is always even

  type COMPLEX_VECTOR is array(NATURAL range <>) of ieee.math_complex.COMPLEX;

  function RE(X:COMPLEX) return SIGNED;
  function IM(X:COMPLEX) return SIGNED;
  function "+"(X,Y:COMPLEX) return COMPLEX;
  function "-"(X,Y:COMPLEX) return COMPLEX;
  function "*"(X,Y:COMPLEX) return COMPLEX;
  function "*"(X:COMPLEX;Y:SIGNED) return COMPLEX;
  function "*"(X:SIGNED;Y:COMPLEX) return COMPLEX;
  function PLUS_i_TIMES(X:COMPLEX) return COMPLEX;
  function MINUS(X:COMPLEX) return COMPLEX;
  function MINUS_i_TIMES(X:COMPLEX) return COMPLEX;
  function X_PLUS_i_TIMES_Y(X,Y:COMPLEX) return COMPLEX;
  function X_MINUS_i_TIMES_Y(X,Y:COMPLEX) return COMPLEX;
  function SWAP(X:COMPLEX) return COMPLEX;
  function CONJ(X:COMPLEX) return COMPLEX;
  function SHIFT_RIGHT(X:COMPLEX;N:INTEGER) return COMPLEX;
  function SHIFT_LEFT(X:COMPLEX;N:INTEGER) return COMPLEX;
  function RESIZE(X:COMPLEX;N:INTEGER) return COMPLEX;
  function TO_COMPLEX(R,I,N:INTEGER) return COMPLEX;
  function TO_COMPLEX(R,I:SIGNED) return COMPLEX;
  function TO_COMPLEX_VECTOR(I:COMPLEX;BINARY_POINT:INTEGER) return COMPLEX_VECTOR;
  function TO_COMPLEX_VECTOR(I0,I1:COMPLEX;BINARY_POINT:INTEGER) return COMPLEX_VECTOR;
  function TO_COMPLEX_VECTOR(I0,I1,I2,I3:COMPLEX;BINARY_POINT:INTEGER) return COMPLEX_VECTOR;
  function TO_COMPLEX_VECTOR(I0,I1,I2,I3,I4,I5,I6,I7:COMPLEX;BINARY_POINT:INTEGER) return COMPLEX_VECTOR;
  function TO_COMPLEX_VECTOR(I0,I1,I2,I3,I4,I5,I6,I7,I8,I9,I10,I11,I12,I13,I14,I15:COMPLEX;BINARY_POINT:INTEGER) return COMPLEX_VECTOR;
  function LOG2(N:INTEGER) return INTEGER; 

