package body COMPLEX_PKG is
  function RE(X:COMPLEX) return SIGNED is
    variable R:SIGNED(X'length/2-1 downto 0);
  begin
    for K in R'range loop
      R(K):=X(X'low+K);
    end loop;
    return R;
  end;

  function IM(X:COMPLEX) return SIGNED is
    variable R:SIGNED(X'length/2-1 downto 0);
  begin
    for K in R'range loop
      R(K):=X(X'length/2+X'low+K);
    end loop;
    return R;
  end;

  function "+"(X,Y:COMPLEX) return COMPLEX is
    variable R:COMPLEX(X'length-1 downto 0);
  begin
    R:=COMPLEX((IM(X)+IM(Y))&(RE(X)+RE(Y)));
    return R;
  end;
  
  function "-"(X,Y:COMPLEX) return COMPLEX is
    variable R:COMPLEX(X'length-1 downto 0);
  begin
    R:=COMPLEX((IM(X)-IM(Y))&(RE(X)-RE(Y)));
    return R;
  end;
  
  function "*"(X,Y:COMPLEX) return COMPLEX is
    variable R:COMPLEX(X'length+Y'length-1 downto 0);
  begin
    R:=TO_COMPLEX(RE(X)*RE(Y)-IM(X)*IM(Y),RE(X)*IM(Y)+IM(X)*RE(Y));
    return R;
  end;

  function "*"(X:COMPLEX;Y:SIGNED) return COMPLEX is
    variable R:COMPLEX(X'length+2*Y'length-1 downto 0);
  begin
    R:=TO_COMPLEX(RE(X)*Y,IM(X)*Y);
    return R;
  end;

  function "*"(X:SIGNED;Y:COMPLEX) return COMPLEX is
    variable R:COMPLEX(2*X'length+Y'length-1 downto 0);
  begin
    R:=TO_COMPLEX(X*RE(Y),X*IM(Y));
    return R;
  end;

  function PLUS_i_TIMES(X:COMPLEX) return COMPLEX is
    variable R:COMPLEX(X'length-1 downto 0);
  begin
    R:=COMPLEX(RE(X)&(-IM(X)));
    return R;
  end;
  
  function MINUS(X:COMPLEX) return COMPLEX is
    variable R:COMPLEX(X'length-1 downto 0);
  begin
    R:=COMPLEX((-IM(X))&(-RE(X)));
    return R;
  end;
  
  function MINUS_i_TIMES(X:COMPLEX) return COMPLEX is
    variable R:COMPLEX(X'length-1 downto 0);
  begin
    R:=COMPLEX((-RE(X))&IM(X));
    return R;
  end;
  
  function X_PLUS_i_TIMES_Y(X,Y:COMPLEX) return COMPLEX is
    variable R:COMPLEX(X'length-1 downto 0);
  begin
    R:=COMPLEX((IM(X)+RE(Y))&(RE(X)-IM(Y)));
    return R;
  end;
  
  function X_MINUS_i_TIMES_Y(X,Y:COMPLEX) return COMPLEX is
    variable R:COMPLEX(X'length-1 downto 0);
  begin
    R:=COMPLEX((IM(X)-RE(Y))&(RE(X)+IM(Y)));
    return R;
  end;
  
  function SWAP(X:COMPLEX) return COMPLEX is
    variable R:COMPLEX(X'length-1 downto 0);
  begin
    R:=COMPLEX(RE(X)&IM(X));
    return R;
  end;
  
  function CONJ(X:COMPLEX) return COMPLEX is
    variable R:COMPLEX(X'length-1 downto 0);
  begin
    R:=COMPLEX((-IM(X))&RE(X));
    return R;
  end;
  
  function SHIFT_RIGHT(X:COMPLEX;N:INTEGER) return COMPLEX is
    variable R:COMPLEX(X'length-1 downto 0);
  begin
    R:=COMPLEX(SHIFT_RIGHT(IM(X),N)&SHIFT_RIGHT(RE(X),N));
    return R;
  end;
  
  function SHIFT_LEFT(X:COMPLEX;N:INTEGER) return COMPLEX is
    variable R:COMPLEX(X'length-1 downto 0);
  begin
    R:=COMPLEX(SHIFT_LEFT(IM(X),N)&SHIFT_LEFT(RE(X),N));
    return R;
  end;
  
  function RESIZE(X:COMPLEX;N:INTEGER) return COMPLEX is
    variable R:COMPLEX(2*N-1 downto 0);
  begin
    R:=COMPLEX(RESIZE(IM(X),N)&RESIZE(RE(X),N));
    return R;
  end;
  
  function TO_COMPLEX(R,I,N:INTEGER) return COMPLEX is
    variable V:COMPLEX(2*N-1 downto 0);
  begin
    V:=COMPLEX(TO_SIGNED(I,N)&TO_SIGNED(R,N));
    return V;
  end;
  
  function TO_COMPLEX(R,I:SIGNED) return COMPLEX is
    variable V:COMPLEX(R'length+I'length-1 downto 0);
  begin
    V:=COMPLEX(I&R);
    return V;
  end;

  function TO_REAL(I:SIGNED;BINARY_POINT:INTEGER) return REAL is
    variable V:REAL;
  begin
    V:=0.0;
    for K in I'low to I'high-1 loop
      if I(K)='1' then
        V:=V+2.0**(K-I'low-BINARY_POINT);
      end if;
    end loop;
    if I(I'high)='1' then
      V:=V-2.0**(I'high-I'low-BINARY_POINT);
    end if;
    return V;
  end;

  function TO_COMPLEX_VECTOR(I:COMPLEX;BINARY_POINT:INTEGER) return COMPLEX_VECTOR is
    variable V:COMPLEX_VECTOR(0 to 0);
  begin
    V(0).RE:=TO_REAL(RE(I),BINARY_POINT);V(0).IM:=TO_REAL(IM(I),BINARY_POINT);
    return V;
  end;

  function TO_COMPLEX_VECTOR(I0,I1:COMPLEX;BINARY_POINT:INTEGER) return COMPLEX_VECTOR is
    variable V:COMPLEX_VECTOR(0 to 1);
  begin
    V(0).RE:=TO_REAL(RE(I0),BINARY_POINT);V(0).IM:=TO_REAL(IM(I0),BINARY_POINT);
    V(1).RE:=TO_REAL(RE(I1),BINARY_POINT);V(1).IM:=TO_REAL(IM(I1),BINARY_POINT);
    return V;
  end;

  function TO_COMPLEX_VECTOR(I0,I1,I2,I3:COMPLEX;BINARY_POINT:INTEGER) return COMPLEX_VECTOR is
    variable V:COMPLEX_VECTOR(0 to 3);
  begin
    V(0).RE:=TO_REAL(RE(I0),BINARY_POINT);V(0).IM:=TO_REAL(IM(I0),BINARY_POINT);
    V(1).RE:=TO_REAL(RE(I1),BINARY_POINT);V(1).IM:=TO_REAL(IM(I1),BINARY_POINT);
    V(2).RE:=TO_REAL(RE(I2),BINARY_POINT);V(2).IM:=TO_REAL(IM(I2),BINARY_POINT);
    V(3).RE:=TO_REAL(RE(I3),BINARY_POINT);V(3).IM:=TO_REAL(IM(I3),BINARY_POINT);
    return V;
  end;

  function TO_COMPLEX_VECTOR(I0,I1,I2,I3,I4,I5,I6,I7:COMPLEX;BINARY_POINT:INTEGER) return COMPLEX_VECTOR is
    variable V:COMPLEX_VECTOR(0 to 7);
  begin
    V(0).RE:=TO_REAL(RE(I0),BINARY_POINT);V(0).IM:=TO_REAL(IM(I0),BINARY_POINT);
    V(1).RE:=TO_REAL(RE(I1),BINARY_POINT);V(1).IM:=TO_REAL(IM(I1),BINARY_POINT);
    V(2).RE:=TO_REAL(RE(I2),BINARY_POINT);V(2).IM:=TO_REAL(IM(I2),BINARY_POINT);
    V(3).RE:=TO_REAL(RE(I3),BINARY_POINT);V(3).IM:=TO_REAL(IM(I3),BINARY_POINT);
    V(4).RE:=TO_REAL(RE(I4),BINARY_POINT);V(4).IM:=TO_REAL(IM(I4),BINARY_POINT);
    V(5).RE:=TO_REAL(RE(I5),BINARY_POINT);V(5).IM:=TO_REAL(IM(I5),BINARY_POINT);
    V(6).RE:=TO_REAL(RE(I6),BINARY_POINT);V(6).IM:=TO_REAL(IM(I6),BINARY_POINT);
    V(7).RE:=TO_REAL(RE(I7),BINARY_POINT);V(7).IM:=TO_REAL(IM(I7),BINARY_POINT);
    return V;
  end;

  function TO_COMPLEX_VECTOR(I0,I1,I2,I3,I4,I5,I6,I7,I8,I9,I10,I11,I12,I13,I14,I15:COMPLEX;BINARY_POINT:INTEGER) return COMPLEX_VECTOR is
    variable V:COMPLEX_VECTOR(0 to 15);
  begin
    V(0).RE:=TO_REAL(RE(I0),BINARY_POINT);V(0).IM:=TO_REAL(IM(I0),BINARY_POINT);
    V(1).RE:=TO_REAL(RE(I1),BINARY_POINT);V(1).IM:=TO_REAL(IM(I1),BINARY_POINT);
    V(2).RE:=TO_REAL(RE(I2),BINARY_POINT);V(2).IM:=TO_REAL(IM(I2),BINARY_POINT);
    V(3).RE:=TO_REAL(RE(I3),BINARY_POINT);V(3).IM:=TO_REAL(IM(I3),BINARY_POINT);
    V(4).RE:=TO_REAL(RE(I4),BINARY_POINT);V(4).IM:=TO_REAL(IM(I4),BINARY_POINT);
    V(5).RE:=TO_REAL(RE(I5),BINARY_POINT);V(5).IM:=TO_REAL(IM(I5),BINARY_POINT);
    V(6).RE:=TO_REAL(RE(I6),BINARY_POINT);V(6).IM:=TO_REAL(IM(I6),BINARY_POINT);
    V(7).RE:=TO_REAL(RE(I7),BINARY_POINT);V(7).IM:=TO_REAL(IM(I7),BINARY_POINT);
    V(8).RE:=TO_REAL(RE(I8),BINARY_POINT);V(8).IM:=TO_REAL(IM(I8),BINARY_POINT);
    V(9).RE:=TO_REAL(RE(I9),BINARY_POINT);V(9).IM:=TO_REAL(IM(I9),BINARY_POINT);
    V(10).RE:=TO_REAL(RE(I10),BINARY_POINT);V(10).IM:=TO_REAL(IM(I10),BINARY_POINT);
    V(11).RE:=TO_REAL(RE(I11),BINARY_POINT);V(11).IM:=TO_REAL(IM(I11),BINARY_POINT);
    V(12).RE:=TO_REAL(RE(I12),BINARY_POINT);V(12).IM:=TO_REAL(IM(I12),BINARY_POINT);
    V(13).RE:=TO_REAL(RE(I13),BINARY_POINT);V(13).IM:=TO_REAL(IM(I13),BINARY_POINT);
    V(14).RE:=TO_REAL(RE(I14),BINARY_POINT);V(14).IM:=TO_REAL(IM(I14),BINARY_POINT);
    V(15).RE:=TO_REAL(RE(I15),BINARY_POINT);V(15).IM:=TO_REAL(IM(I15),BINARY_POINT);
    return V;
  end;

  function LOG2(N:INTEGER) return INTEGER is
    variable TEMP:INTEGER;
    variable RESULT:INTEGER;
  begin
    TEMP:=N;
    RESULT:=0;
    while TEMP>1 loop
      RESULT:=RESULT+1;
      TEMP:=(TEMP+1)/2;
    end loop;  
    return RESULT; 
  end; 

end COMPLEX_PKG;
